import React, { useState } from 'react';
import { Menu } from 'semantic-ui-react'

function NavBar() {

    return (
        <Menu pointing secondary>
            <Menu.Item  name='home' href="/"/>
            <Menu.Item  name='posts' href="/"/>
            <Menu.Item  name='contact' href="/"/>
        </Menu>
    )
}

export default NavBar;
